import axios from "axios";
import React from "react";

const baseURL = "http://localhost:7000/userData/";

export default function App() {
  const [previous, setNew] = React.useState(null);

  React.useEffect(() => {
    axios.get(baseURL).then((response) => {
      setNew(response.data);
    });
  }, []);



  if (!previous) return null;

  console.log(JSON.stringify(previous[0]));
  return (
    <div>
    <h1>Doctor Data to be render</h1>
      <div>{previous.name}</div>
      <div>{previous.age}</div>
      <div>{previous.gender}</div>
      <div>{previous.location}</div>
      <div>{previous.phoneNo}</div>
    </div>
  );
}
